svg.script:
(function () {
  var svg = document.currentScript && document.currentScript.ownerSVGElement;
  if (!svg) return;
  var layers = ["#3sloj", "#2sloj", "#1sloj"];
  var paths = [];
  layers.forEach(function (sel) {
    var g = svg.querySelector(sel);
    if (g) {
      paths = paths.concat(Array.from(g.querySelectorAll("path")));
    }
  });
  // fallback include any remaining paths
  svg.querySelectorAll("path").forEach(function (p) {
    if (paths.indexOf(p) === -1) paths.push(p);
  });
  paths.forEach(function (path, idx) {
    var fill = path.getAttribute("fill") || "#3d4a2c";
    var length = Math.ceil(path.getTotalLength ? path.getTotalLength() : 1200);
    path.style.setProperty("--fill-color", fill);
    path.style.setProperty("--stroke-color", fill);
    path.style.setProperty("--path-length", length);
    path.style.setProperty("--path-delay", (idx * 0.12).toFixed(2) + "s");
    path.setAttribute("stroke", fill);
    path.setAttribute("fill", "transparent");
    path.classList.add("logo-path");
  });
})();
